import React, { Component } from 'react';
import CardList from './CardList';
import {Profile} from './Profile'
class App extends Component{
    render(){
        return(
            <div className="tc">
                <h1 className="tc-lightest-blue">Shortlisted Profile</h1>
                 <CardList Profile={Profile}/>
            </div>
        );
    }
}
export default App;
